import React from 'react';
import * as icons from '../../theme/icons/index'

const Icons = ({type}) => {
    // const { type, color, filled, width, height, onClick, className } = props;

    console.log(icons);
    const icon = icons[type];

    return (
        <span>
            icon
        </span>
    );
};

export default Icons;
